import React from "react";
import { Grid, Paper } from "@material-ui/core";

export default props => (
  <Grid container sm={12}>
    <Grid item sm={6}>
      <Paper style={{ padding: 20 }}>Left pane</Paper>
    </Grid>
    <Grid item sm={6}>
      <Paper style={{ padding: 20 }}>Right pane</Paper>
    </Grid>
  </Grid>
);
